import React from 'react';
import Webcam from 'react-webcam';
import {Container, Row, Col, Jumbotron} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css';
class Camera extends React.Component{
	constructor(props){

	}
	componentDidMount(){
		navigator.getUserMedia = navigator.getUserMedia || navigator.webkitGetUserMedia || navigator.mozGetUserMedia || navigator.msGetUserMedia || navigator.oGetUserMedia;
    	if (navigator.getUserMedia) {
        navigator.getUserMedia({video: true}, this.handleVideo, this.videoError);
    	}
	}
	render(){
		return(
			<Container fluid>
					<Jumbotron>
						<Row className="justify-content-md-center">
					  		<h1 className="title">smileAI</h1>
					  	</Row>
					  	<Row className="justify-content-md-center">
						  <p>
						    Simple AI that detects smiles. Positive vibes only.
						  </p>
						</Row>
						<Row className="justify-content-md-center">
							<p>
								<small>Neural network built without any deep learning libraries (only numpy).</small>
							</p>
						</Row>
					</Jumbotron>
				<Row className="justify-content-md-center">
				    <Col xs={6}><video id="video" autoplay="true" src={this.state.video}></video></Col>
				</Row>
			</Container>

		)
	}
}

export default Camera;
